import React, { useState, useEffect } from 'react';
import axios from 'axios';

function MDTList() {
    const [mdts, setMdts] = useState([]);

    useEffect(() => {
        axios.get('/mdts').then(response => {
            setMdts(response.data);
        });
    }, []);

    return (
        <div>
            <h2>MDT Inventory</h2>
            <table>
                <thead>
                    <tr>
                        <th>PC Serial</th>
                        <th>PC Model</th>
                        <th>Aircard IP</th>
                        <th>PC Name</th>
                        <th>Term ID</th>
                    </tr>
                </thead>
                <tbody>
                    {mdts.map(mdt => (
                        <tr key={mdt.mdt_id}>
                            <td>{mdt.pc_serial}</td>
                            <td>{mdt.pc_model}</td>
                            <td>{mdt.aircard_ip}</td>
                            <td>{mdt.pc_name}</td>
                            <td>{mdt.term_id}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default MDTList;
